IF OBJECT_ID('dbo.proc_transform_241', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_241;
GO
CREATE PROCEDURE dbo.proc_transform_241
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_241
    SET payload = LEFT(payload, 1000) + N'|V4-241|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_241;
END
